/// <summary>
/// The method returns <c>True</c> if the passed vendor transaction was created as a result of a customs journal posting.
/// </summary>
/// <param name = "_custVendTrans">A customer of vendor transaction.</param>
/// <returns><c>True</c> if the passed vendor transaction was created as a result of a customs journal posting.</returns>
[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public static boolean isVoucherRelatedToCustomsJournal(CustVendTrans _custVendTrans)
{
    if (_custVendTrans.TableID != tableNum(VendTrans)
        || !SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU])
        || _custVendTrans.Invoice)
    {
        return false;
    }

    CustomJournalTable_RU customJournalTable;
    select firstonly RecId from customJournalTable
        where customJournalTable.LedgerVoucher == _custVendTrans.Voucher
            && customJournalTable.PlanArrivalDate == _custVendTrans.TransDate;

    if (customJournalTable)
    {
        return true;
    }

    return false;
}

