[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
TransDate applyPlanArrivalDate(boolean _autoAcceptDialog = false)
{
    CustomJournalTransCreate_RU customJournalTransCreate;
    CustomJournalCalc_RU        customJournalCalc;
    CustomGTDDate_RU            customGTDDate;

    if (!_autoAcceptDialog
    &&  ((this.InventGTDId
    &&  (DialogButton::No == Box::yesNo("@GLS115369", DialogButton::No, "@SYS12529"))) ||
        (DialogButton::No == Box::yesNo("@GLS115373", DialogButton::No, "@SYS12529"))))
    {
        checkFailed(strfmt("@SYS70800"));
        return this.orig().PlanArrivalDate;
    }

    ttsbegin;

    customJournalTransCreate = CustomJournalTransCreate_RU::construct(this.CustomJournalType);
    customJournalTransCreate.parmCustomJournalTable(this);
    customJournalTransCreate.reCreateTrans();

    customJournalCalc = CustomJournalCalc_RU::construct();
    customJournalCalc.initFromTable(this);
    customJournalCalc.recalcCharge();

    ttscommit;

    if (this.InventGTDId)
    {
        customGTDDate    = date2str(this.PlanArrivalDate, 0, 2, 0, 2, 0, 2, 0);
        this.InventGTDId = CustomJournalGTDBase_RU::formatGTDId(this.CustomPostId, customGTDDate, CustomJournalGTDBase_RU::getGTDSubNum(this.InventGTDId));
    }

    return this.PlanArrivalDate;
}

