private boolean checkAgreement()
{
    SalesAgreementHeader salesAgreementHeader;
    PurchAgreementHeader purchAgreementHeader;
    boolean ok = true;

    if (this.AgreementHeaderExt)
    {
        switch (this.CustomJournalType)
        {
            case CustomJournalType_RU::Export:
                salesAgreementHeader = SalesAgreementHeaderExt_RU::salesAgreementHeader(this.AgreementHeaderExt);

                if (!salesAgreementHeader.canReleaseAgreement())
                {
                    ok = checkFailed("@SYS103075");
                }

                if (salesAgreementHeader.CustAccount != this.PartnerCode)
                {
                    ok = checkFailed(strFmt("@SYS112224",
                        salesAgreementHeader.SalesNumberSequence, "@SYS309959", tableId2pname(tableNum(SalesAgreementHeader))));
                }
                break;
            case CustomJournalType_RU::Import:
                purchAgreementHeader = PurchAgreementHeaderExt_RU::purchAgreementHeader(this.AgreementHeaderExt);

                if (!purchAgreementHeader.canReleaseAgreement())
                {
                    ok = checkFailed("@SYS103075");
                }

                if (purchAgreementHeader.VendAccount != this.PartnerCode)
                {
                    ok = checkFailed(strFmt("@SYS112224",
                        purchAgreementHeader.PurchNumberSequence, "@SYS309960", tableId2pname(tableNum(PurchAgreementHeader))));
                }
                break;
        }
    }

    return ok;
}

private boolean checkCustomAgreement()
{
    PurchAgreementHeader purchAgreementHeader;
    boolean ok = true;

    if (this.CustomAgreementHeaderExt)
    {
        purchAgreementHeader = PurchAgreementHeaderExt_RU::purchAgreementHeader(this.CustomAgreementHeaderExt);

        if (!purchAgreementHeader.canReleaseAgreement())
        {
            ok = checkFailed("@SYS103075");
        }

        if ((this.CounteragentType == CustomPartnerType_RU::Broker && purchAgreementHeader.VendAccount != this.VendAccountBroker) ||
            (this.CounteragentType == CustomPartnerType_RU::Custom && purchAgreementHeader.VendAccount != this.VendAccountCustom))
        {
            ok = checkFailed("@SYS334899");
        }
    }

    return ok;
}

private boolean checkCustomLocation()
{
    boolean ret = true;

    boolean existsCustomLocation(VendAccount _vendAccountCustom, InventLocationId _customLocation)
    {
        return (select firstOnly RecId from InventLocation
                where InventLocation.InventLocationId     == _customLocation
                   && InventLocation.VendAccountCustom_RU == _vendAccountCustom).RecId != 0;
    }

    if (this.CustomLocationId)
    {
        if (this.VendAccountCustom)
        {
            if (!existsCustomLocation(this.VendAccountCustom, this.CustomLocationId))
            {
                this.CustomLocationId = "";
                ret = false;
            }
        }
    }

    return ret;
}

private boolean checkCustomPost()
{
    boolean ret = true;

    if (this.CustomPostId)
    {
        if (!this.VendAccountCustom)
        {
            this.VendAccountCustom  = CustomPosts_RU::postPartnerCode(this.CustomPostId);
        }
        if (this.VendAccountCustom)
        {
            ret = CustomPosts_RU::checkExist(this.VendAccountCustom, this.CustomPostId);
        }
    }

    return ret;
}

