        this.DefaultDimension = LedgerDimensionDefaultFacade::serviceMergeDefaultDimensions(this.DefaultDimension, AgreementHeaderExt_RU::agreementHeader(this.CustomAgreementHeaderExt).DefaultDimension);
    }
    else
