                this.DefaultDimension = 0;
            }
        }
        else if (this.CounteragentType == CustomPartnerType_RU::Custom)
        {
            if (this.VendAccountCustom)
            {
                this.DefaultDimension = VendTable::find(this.VendAccountCustom).DefaultDimension;
            }
            else
            {
                this.DefaultDimension = 0;
            }
        }
    }
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
DlvTermId initDlvTermId()
{
    DlvTermId dlvTermId = AgreementHeaderDefault::findAgreementHeader(this.agreementHeaderExt().AgreementHeader).DeliveryTerm;

    if (!dlvTermId)
    {
        if (this.CustomJournalType == CustomJournalType_RU::Export)
        {
            dlvTermId = CustTable::find(this.PartnerCode).DlvTerm;
        }
        else if (this.CustomJournalType == CustomJournalType_RU::Import)
        {
            dlvTermId = VendTable::find(this.PartnerCode).DlvTerm;
        }
    }

    this.CustomInventTransStatus = DlvTerm::find(dlvTermId).CustomInventTransStatus_RU;

    return dlvTermId;
}

/// <summary>
///     Initializes a <c>CustomJournalTable_RU</c> record with values based on <c>AgreementHeaderExt_RU</c> record.
/// </summary>
/// <param name="_agreementHeaderExt">
///     Record of <c>AgreementHeaderExt_RU</c> table to copy initial values from.
/// </param>
/// <param name="_custom">
///     True if the initialization is from customs services vendor; otherwise, false.
/// </param>
[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
void initFromAgreementHeaderExt(AgreementHeaderExt_RU _agreementHeaderExt,
                                boolean               _custom)
{
    DlvTerm                     dlvTerm;
    SalesAgreementHeaderExt_RU  salesAgreementHeaderExt;
    SalesAgreementHeaderDefault salesAgreementHeaderDefault;
    PurchAgreementHeaderExt_RU  purchAgreementHeaderExt;
    PurchAgreementHeaderDefault purchAgreementHeaderDefault;
    PaymMode                    paymMode;
    SalesInvoicePostingType_RU  invoicePostingType;
    DlvTermId                   dlvTermId;

    if (_agreementHeaderExt is SalesAgreementHeaderExt_RU)
    {
        salesAgreementHeaderExt = _agreementHeaderExt as SalesAgreementHeaderExt_RU;
        salesAgreementHeaderDefault = SalesAgreementHeaderDefault::findSalesAgreementHeader(salesAgreementHeaderExt.AgreementHeader);
        paymMode = salesAgreementHeaderDefault.CustomerMethodOfPayment;
        invoicePostingType = salesAgreementHeaderExt.SalesInvoicePostingType;
    }
    else
    if (_agreementHeaderExt is PurchAgreementHeaderExt_RU)
    {
        purchAgreementHeaderExt = _agreementHeaderExt as PurchAgreementHeaderExt_RU;
        purchAgreementHeaderDefault = PurchAgreementHeaderDefault::findPurchAgreementHeader(purchAgreementHeaderExt.AgreementHeader);
        paymMode = purchAgreementHeaderDefault.MethodOfPayment;
        invoicePostingType = SalesInvoicePostingType_RU::Standard;
    }

    if (_custom)
    {
        if (paymMode)
        {
            this.PaymentMode = paymMode;
        }
    }
    else
    {
        dlvTermId = AgreementHeaderDefault::findAgreementHeader(_agreementHeaderExt.AgreementHeader).DeliveryTerm;

        if (dlvTermId)
        {
            dlvTerm = DlvTerm::find(dlvTermId);
            if (dlvTerm.RecId)
            {
                this.CustomInventTransStatus = dlvTerm.CustomInventTransStatus_RU;
            }
        }

        this.InvoicePostingType = invoicePostingType;
    }
}

public void initValue()
{
    super();

    this.CustomJournalId        = NumberSeq::newGetNum(InventParameters::numRefCustomJournalId_RU()).num();
    this.PlanArrivalDate        = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone());
    this.IncludeIntoCostPrice   = NoYes::Yes;
}

