public void modifiedField(fieldId _fieldId, boolean _autoAcceptDialog = false)
{
    #define.one(1)
    CustomJournalTable_RU   customJournalTable_RU = this.orig();
    CustomJournalTrans_RU   customJournalTrans;
    FormDataSource          formDataSource;
    FormRun                 formRun;
    Object                  formRunObject;
    InventLocation          inventLocation;
    CustomJournalCalc_RU    customJournalCalc;

    super(_fieldId);

    switch (_fieldId)
    {
        case fieldnum(CustomJournalTable_RU, CustomJournalType):
            this.PartnerCode        = '';
            this.AgreementHeaderExt    = 0;
            if (this.CustomJournalType == CustomJournalType_RU::Export)
            {
                this.IncludeIntoCostPrice   = NoYes::No;
                this.DlvTermId              = '';
            }
            this.InventProfileId    = this.inventProfileId();
            this.InvoicePostingType = this.invoicePostingType();
            break;

        case fieldnum(CustomJournalTable_RU, CustomInventTransStatus):
            this.InventProfileId    = this.inventProfileId();
            break;

        case fieldnum(CustomJournalTable_RU, DlvTermId):
            this.CustomInventTransStatus    = DlvTerm::find(this.DlvTermId).CustomInventTransStatus_RU;
            this.InventProfileId            = this.inventProfileId();
            break;

        case fieldnum(CustomJournalTable_RU, PartnerCode):
            this.AgreementHeaderExt    = 0;
            this.DlvTermId          = this.initDlvTermId();
            this.InventProfileId    = this.inventProfileId();
            this.InvoicePostingType = this.invoicePostingType();
            break;

        case fieldnum(CustomJournalTable_RU, CounteragentType):
            this.CustomAgreementHeaderExt      = 0;
            this.PaymentMode                = '';
            switch (this.CounteragentType)
            {
                case CustomPartnerType_RU::Broker:
                    if (this.CounteragentType != this.orig().CounteragentType)
                    {
                        if (this.VendAccountBroker &&
                            CustomPartners_RU::find(this.VendAccountBroker).CustomServiceProvider != CustomServiceProvider_RU::Self &&
                            CustomPartners_RU::find(this.VendAccountBroker).CustomServiceProvider != CustomServiceProvider_RU::SelfCustom)
                        {
                            this.VendAccountBroker = "";
                        }
                    }
                    break;

                case CustomPartnerType_RU::Custom:
                    if (this.VendAccountBroker &&
                        CustomPartners_RU::find(this.VendAccountBroker).CustomServiceProvider != CustomServiceProvider_RU::Custom &&
                        CustomPartners_RU::find(this.VendAccountBroker).CustomServiceProvider != CustomServiceProvider_RU::SelfCustom)
                    {
                        this.VendAccountBroker = "";
                    }
                    break;
            }
            this.initDimension();
            break;

        case fieldnum(CustomJournalTable_RU, VendAccountCustom):
            if (this.RecId && this.VendAccountCustom != this.orig().VendAccountCustom)
            {
                this.VendAccountCustom = this.applyVendAccountCustom(_autoAcceptDialog);
            }

            if (this.CounteragentType == CustomPartnerType_RU::Custom)
            {
                this.CustomAgreementHeaderExt = 0;
                this.initDimension();
            }

            select count(RecId) from inventLocation where inventLocation.VendAccountCustom_RU == this.VendAccountCustom;

            if (inventLocation.RecId == #one)
            {
                select firstOnly InventLocationId from inventLocation
                    where inventLocation.VendAccountCustom_RU == this.VendAccountCustom;
                this.CustomLocationId = inventLocation.InventLocationId;
            }
            else
            {
                this.CustomLocationId = "";
            }

            this.PostingProfile = this.customVendPostingProfile();

            if (this.VendAccountCustom)
            {
                if (!CustomPosts_RU::exist(this.VendAccountCustom, this.CustomPostId))
                {
                    this.CustomPostId = CustomPosts_RU::getSinglePost(this.VendAccountCustom);
                }
            }
            break;

        case fieldNum(customJournalTable_RU, CustomPostId):
            if (!this.VendAccountCustom)
            {
                this.VendAccountCustom = CustomPosts_RU::postPartnerCode(this.CustomPostId);
            }
            if (this.VendAccountCustom != this.orig().VendAccountCustom)
            {
                this.modifiedField(fieldNum(CustomJournalTable_RU, VendAccountCustom));
            }
            break;

        case fieldnum(CustomJournalTable_RU, VendAccountBroker):
            if (this.VendAccountBroker != this.orig().VendAccountBroker)
            {
                if (this.CounteragentType == CustomPartnerType_RU::Broker)
                {
                    this.CustomAgreementHeaderExt = 0;
                    this.initDimension();
                }
            }
            break;

        case fieldnum(CustomJournalTable_RU, customAgreementHeaderExt):
            if (this.CustomAgreementHeaderExt)
            {
                this.initFromAgreementHeaderExt(this.customAgreementHeaderExt(), true);
            }
            this.initDimension();
            this.PostingProfile = this.customVendPostingProfile();
            break;

        case fieldnum(CustomJournalTable_RU, AgreementHeaderExt):
            this.initFromAgreementHeaderExt(this.AgreementHeaderExt(), false);
            this.DlvTermId          = this.initDlvTermId();
            this.InventProfileId    = this.inventProfileId();
            break;

        case fieldnum(CustomJournalTable_RU, IncludeIntoCostPrice):
            if (this.IncludeIntoCostPrice == NoYes::No)
            {
                this.ChargeAllocationBase = CustomChargeAllocationBase_RU::Amount;
            }
            break;

        case fieldnum(CustomJournalTable_RU, CustomLocationId):
            if (this.CustomLocationId && this.VendAccountCustom)
            {
                inventLocation = InventLocation::find(this.CustomLocationId);
                if (inventLocation.VendAccountCustom_RU != this.VendAccountCustom)
                {
                    if (_autoAcceptDialog || Box::yesNo(strfmt("@GLS115447", inventLocation.VendAccountCustom_RU), DialogButton::Yes) == DialogButton::Yes)
                    {
                        this.VendAccountCustom  = inventLocation.VendAccountCustom_RU;
                        if (this.CounteragentType == CustomPartnerType_RU::Custom)
                        {
                            this.CustomAgreementHeaderExt = 0;
                            this.initDimension();
                        }
                    }
                }
            }
            if (this.CustomLocationId && ! this.VendAccountCustom)
            {
                this.VendAccountCustom = InventLocation::find(this.CustomLocationId).VendAccountCustom_RU;
            }
            if (this.VendAccountCustom != this.orig().VendAccountCustom)
            {
                this.modifiedField(fieldNum(CustomJournalTable_RU, VendAccountCustom));
            }

            break;

        case fieldnum(CustomJournalTable_RU, CalculationMethod):
            if (this.RecId && this.CalculationMethod != this.orig().CalculationMethod)
            {
                select count(RecId) from customJournalTrans
                    where customJournalTrans.CustomJournalId == this.CustomJournalId;

                if (customJournalTrans.RecId > 0)
                {
                    if (Box::okCancel("@GLS115448", DialogButton::Cancel) == DialogButton::Ok)
                    {
                        ttsbegin;
                        while select forupdate customJournalTrans
                            where customJournalTrans.CustomJournalId == this.CustomJournalId
                        {
                            customJournalTrans.CalculationMethod = this.CalculationMethod;
                            customJournalTrans.update();
                        }
                        ttscommit;
                    }
                }
                this.write();

                customJournalCalc = CustomJournalCalc_RU::construct();
                customJournalCalc.initFromTable(this);
                customJournalCalc.recalcTable();

                formDataSource = FormDataUtil::getFormDataSource(this);
                formRun        = formDataSource.formRun();

                if (formRun && formHasMethod(formRun, identifierstr(transFormDataSource)))
                {
                    formRunObject  = formRun;
                    formDataSource = formRunObject.transFormDataSource();
                    formDataSource.research();
                }
            }
            break;

        case fieldnum(CustomJournalTable_RU, CountryRegionId):
            if (this.RecId)
            {
                this.transCascadeUpdate(_fieldId, fieldnum(CustomJournalTrans_RU, CountryRegionId), false, true);
            }
            break;

        case fieldnum(CustomJournalTable_RU, PlanArrivalDate):
            if (this.RecId && this.PlanArrivalDate != this.orig().PlanArrivalDate)
            {
                this.write();
                this.PlanArrivalDate = this.applyPlanArrivalDate(_autoAcceptDialog);
            }
            break;
    }
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
display Name partnerName()
{
    switch (this.CustomJournalType)
    {
        case CustomJournalType_RU::Import:
            return VendTable::find(this.PartnerCode).name();
        case CustomJournalType_RU::Export:
            return CustTable::find(this.PartnerCode).name();
    }

    return "";
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public void transCascadeUpdate(fieldId  _fieldIdTable,
                               fieldId  _fieldIdTrans,
                               boolean  _skipNotEmpty = false,
                               boolean  _skipModifiedField = false)
{
    CustomJournalTrans_RU   customJournalTrans;

    ttsbegin;

    while select forupdate customJournalTrans
        where customJournalTrans.CustomJournalId == this.CustomJournalId
    {
        if (! _skipNotEmpty || ! customJournalTrans.(_fieldIdTrans))
        {
            customJournalTrans.(_fieldIdTrans) = this.(_fieldIdTable);
            if (!_skipModifiedField)
            {
                customJournalTrans.modifiedField(_fieldIdTrans);
            }
            customJournalTrans.update();
        }
    }

    ttscommit;
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
void updateChangeInLines()
{
    boolean changeInLines;

    changeInLines = (select firstonly customJournalTrans_RU
                         where customJournalTrans_RU.CustomJournalId == this.CustomJournalId &&
                               customJournalTrans_RU.ChangeInLines).RecId ? true : false;

    if (this.ChangeInLines != changeInLines)
    {
        ttsbegin;
        this.selectForUpdate(true);
        this.ChangeInLines = changeInLines;
        this.doUpdate();
        ttscommit;
    }
}

private void updateTransAgreementDimension()
{
    CustomJournalTrans_RU customJournalTrans;

    if (this.CustomAgreementHeaderExt)
    {
        while select forUpdate customJournalTrans
        {
            customJournalTrans.DefaultDimension = AgreementHeaderExt_RU::createAgreementDimension(
                this.CustomAgreementHeaderExt,
                customJournalTrans.DefaultDimension);
            customJournalTrans.doUpdate();
        }
    }
    else
    {
        while select forUpdate customJournalTrans
            where customJournalTrans.DefaultDimension
        {
            customJournalTrans.DefaultDimension = AgreementHeaderExt_RU::clearAgreementDimension(customJournalTrans.DefaultDimension);
            customJournalTrans.doUpdate();
        }
    }
}

public boolean validateField(fieldId _fieldIdToCheck)
{
    boolean         ret;
    InventLocation  inventLocation;

    switch (_fieldIdToCheck)
    {
        case fieldNum(CustomJournalTable_RU, CustomPostId):
            if (!this.VendAccountCustom && this.CustomPostId)
            {
                this.VendAccountCustom = CustomPosts_RU::postPartnerCode(this.CustomPostId);
                if (!this.VendAccountCustom)
                {
                    return true;
                }
            }
            break;
    }

    ret = super(_fieldIdToCheck);

    if (ret)
    {
        switch (_fieldIdToCheck)
        {
            case fieldnum(CustomJournalTable_RU, CustomLocationId):
                if (this.CustomLocationId)
                {
                    select firstonly inventLocation
                        where inventLocation.InventLocationId == this.CustomLocationId &&
                            ((this.VendAccountCustom != "" && inventLocation.VendAccountCustom_RU == this.VendAccountCustom) ||
                             (this.VendAccountCustom == "" && inventLocation.VendAccountCustom_RU != ""));

                    if (!inventLocation)
                    {
                        ret = checkFailed("@GLS115433");
                    }
                }
                break;
            case fieldNum(CustomJournalTable_RU, AgreementHeaderExt):
                ret = this.checkAgreement();
                break;
            case fieldNum(CustomJournalTable_RU, CustomAgreementHeaderExt):
                ret = this.checkCustomAgreement();
                break;
            case fieldNum(CustomJournalTable_RU, CustomPostId):
                ret = this.checkCustomPost();
                break;
        }
    }

    return ret;
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if (this.CounteragentType == CustomPartnerType_RU::Broker && !this.VendAccountBroker)
    {
        ret = checkFailed(strfmt("@GLS115316", fieldid2pname(tablenum(CustomJournalTable_RU), fieldnum(CustomJournalTable_RU, VendAccountBroker))));
    }

    if (this.CustomJournalType == CustomJournalType_RU::Import && !this.DlvTermId)
    {
        ret = checkFailed(strfmt("@GLS115316", fieldid2pname(tablenum(CustomJournalTable_RU), fieldnum(CustomJournalTable_RU, DlvTermId))));
    }

    if (this.CustomJournalType == CustomJournalType_RU::Import &&
        this.DlvTermId && DlvTerm::find(this.DlvTermId).CustomInventTransStatus_RU == CustomInventTransStatus_RU::Empty)
    {
        ret = checkFailed(strfmt("@GLS115406", this.DlvTermId));
    }

    if (!this.CustomPostId)
    {
        ret = checkFailed(strFmt("@GLS115316", fieldPName(CustomJournalTable_RU, CustomPostId)));
    }

    if (ret)
    {
        ret = this.checkCustomPost() && ret;
    }

    return ret;
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public static CustomJournalTable_RU find(CustomJournalId_RU _customJournalId,
                                         boolean            _forupdate = false)
{
    CustomJournalTable_RU customJournalTable;

    customJournalTable.selectForUpdate(_forupdate);

    if (_customJournalId)
    {
        select firstonly customJournalTable
            where customJournalTable.CustomJournalId == _customJournalId;
    }

    return customJournalTable;
}

