[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public static CustomJournalTable_RU findByGTDId(InventGTDId_RU  _inventGTDId,
                                                RefRecId        _excludeRecId = 0,
                                                boolean         _forupdate = false)
{
    CustomJournalTable_RU customJournalTable;

    customJournalTable.selectForUpdate(_forupdate);

    if (_inventGTDId)
    {
        select firstonly customJournalTable
            where customJournalTable.InventGTDId == _inventGTDId &&
                  (! _excludeRecId || customJournalTable.RecId != _excludeRecId);
    }

    return customJournalTable;
}

