}

/// <summary>
/// Checks whether <c>_inventGTDId</c> exists in the customs journal with id other than <c>_customJournalId</c>
/// </summary>
/// <param name="_inventGTDId">
/// The inventory GTD number to check.
/// </param>
/// <param name="_customJournalId">
/// The customs journal identifier to exclude from the check.
/// </param>
/// <returns>
/// A <c>Boolean</c> indicating whether the given <c>_inventGTDId</c> number exists in the customs journal with id other than <c>_customJournalId</c>.
/// </returns>
/// <remarks>
/// Both parameters must not be blank for the actual check to take place.
/// </remarks>
[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public static boolean gtdExistExceptForJournal(InventGTDId_RU _inventGTDId, CustomJournalId_RU _customJournalId)
{
    #define.blank('')
    return _inventGTDId && _customJournalId
        && (select firstOnly InventGTDId from CustomJournalTable_RU
            where CustomJournalTable_RU.InventGTDId == _inventGTDId
               && CustomJournalTable_RU.CustomJournalId != _customJournalId).InventGTDId != #blank;
}
